import React from 'react'
import s from './Precart.module.css'
import { useSelector } from 'react-redux'
import { Link } from 'react-router-dom'

export default function Precart() {
    const cart_products = useSelector(state => state.precard)
    console.log(cart_products)
  return (
    <div className={s.precart}>
        {cart_products.length > 0 ? 
          <div className={s.h3}>Your cart is empty, please select something <Link to={'/products'} >here</Link></div>:
          cart_products.map(el => <div key={el.id}>{el.product}</div>)
        }
    </div>
  )
}
